class Solution {

    private $grid;
    private $cache = [];
    private $m;
    private $n;

    private $cnt;

    function go() {

        $q = new SplPriorityQueue();
        $q->insert([$this->grid[0][0], 0, 0], $this->grid[0][0]);

        $min = PHP_INT_MAX;

        while (!$q->isEmpty()) {

            $a = $q->extract();
            $min = min($min, $a[0]);

            $x = $a[1];
            $y = $a[2];
            if ($x==$this->m-1 and $y==$this->n-1) break;
            $this->grid[$x][$y] = -1;

            if ($x<$this->m-1 and $this->grid[$x+1][$y]>-1) {
                $q->insert([$this->grid[$x+1][$y], $x+1, $y], $this->grid[$x+1][$y]);
            }
    
            if ($y<$this->n-1 and $this->grid[$x][$y+1]>-1) {
                $q->insert([$this->grid[$x][$y+1], $x, $y+1], $this->grid[$x][$y+1]);
            }
    
            if ($x>0 and $this->grid[$x-1][$y]>-1) {
                $q->insert([$this->grid[$x-1][$y], $x-1, $y], $this->grid[$x-1][$y]);
            }
    
            if ($y>0 and $this->grid[$x][$y-1]>-1) {
                $q->insert([$this->grid[$x][$y-1], $x, $y-1], $this->grid[$x][$y-1]);
            }            
        }

        return $min;
    }



    function find1($x, $y, $score) {        

        //echo "x=$x y=$y sc=$score c={$this->grid[$x][$y]}".PHP_EOL;
        //if ($this->cnt++==100) exit;

        if ($x==$this->m-1 and $y==$this->n-1) return $score;
        if (isset($this->cache[$x][$y])) return $this->cache[$x][$y];

        $this->cache[$x][$y] = $score;

        $q = new SplPriorityQueue();

        if ($x<$this->m-1 and !isset($this->cache[$x+1][$y])) {
            if ($this->grid[$x+1][$y]>=$score) $q->insert([$x+1, $y], $this->grid[$x+1][$y]);
        }        

        if ($y<$this->n-1 and !isset($this->cache[$x][$y+1])) {
            if ($this->grid[$x][$y+1]>=$score) $q->insert([$x, $y+1], $this->grid[$x][$y+1]);
        }

        if ($x>0 and !isset($this->cache[$x-1][$y])) {
            if ($this->grid[$x-1][$y]>=$score) $q->insert([$x-1, $y], $this->grid[$x-1][$y]);
        }

        if ($y>0 and !isset($this->cache[$x][$y-1])) {
            if ($this->grid[$x][$y-1]>=$score) $q->insert([$x, $y-1], $this->grid[$x][$y-1]);
        }        

        do {
            if (!$q->count()) return false;
            $a = $q->extract();
            if (!isset($this->cache[$a[0]][$a[1]])) $r = $this->find1($a[0], $a[1], $score);
            //var_dump($r);
        } while ($r===false);

        return $score;        
    }

    function approach1() {      // iterate max.min score
        $s = min($this->grid[0][0], $this->grid[$this->m-1][$this->n-1]);
        for ($score=$s; $score>=0; $score--) {
            $this->cache = [];
            $ss = $this->find1(0, 0, $score);
            if ($ss) return $ss;
        }
        return 0;
    }

    function approach2() {      // binary search, approach1
        $left = 0;
        $right = min($this->grid[0][0], $this->grid[$this->m-1][$this->n-1]);
        while ($left < $right) {
            $middle = floor(($left + $right + 1) / 2);
            //echo "left=$left middle=$middle right=$right".PHP_EOL;
            $this->cache = [];
            if ($this->find1(0, 0, $middle)) {
                $left = $middle;
            } else {
                $right = $middle - 1;
            }
        }

        return $left;
    }

    /**
     * @param Integer[][] $grid
     * @return Integer
     */
    function maximumMinimumPath($grid) {
        
        $this->grid = $grid;
        $this->m = count($grid);
        $this->n = count($grid[0]);
        return $this->go();
        //return $this->approach2();
    }
}

